import React from "react";
import {BrowserRouter as Router, Route} from "react-router-dom";

import Navbar from "./components/navbar"
import Timeline from "./components/timeline"
import Welcome from "./components/welcome"
import Projects from "./components/projects"

import "./public/styles/style.css";
import logo1 from './public/images/FarmtoFork.png';
import logo2 from './public/images/Logo.png';

function App() {
  return (
      <div className="app">
        <Navbar />
        <Welcome title="WELCOME" />
        <Timeline />
        <Welcome title="PROJECTS" />
        <Projects textTitle="Desarrollo de una plataforma web en relación con el proyecto DEMETER, para el seguimiento de productos, junto al equipo de investigación de Ingeniería de Redes y Servicios Avanzados de Telecomunicación perteneciente al departamento de Sistemas Informáticos en la universidad Politécnica de Madrid." img={logo1} url="https://github.com/AnthonyRich13/TrFood" title="TrFood" text="Para los 6 meses de prácticas realizados en el equipo de investigación de Redes y Servicios Avanzados de Telecomunicación
            se realizó una plataforma web haciendo uso de Nodejs, MongoDB, Passport y Angular entre otras herramientas. Esta plataforma tiene la función de dar la posiblidad de realizar un seguimiento de productos y alimentos desde su punto de inicio
            hasta su venta posterior. Este punto de inicio puede ser una granja, una fábrica o incluso otro comercio, y en el seguimiento se pasará
            por diferentes etapas, las cuales irán quedando registradas. Esta iniciativa sigue la estrategia llamada Farm to Fork, el cual es un movimiento
            importante actualmente que está recogido dentro del Pacto Verde Europeo, realizado por la comisión europea. </p>
            La plataforma tiene varios puntos"/>
      </div>
  );
}

export default App;
